import { html } from "https://unpkg.com/lit-html";

const stories = {
  "en morgon": [
    "Vilhelm sitter p√• pottan",
    "data:image/jpeg;base64,",
    "Vilhelm √§ter macka",
    "data:image/jpeg;base64,",
    "Vilhelm √•ker bil",
    "data:image/jpeg;base64,"
  ]
};
export default function read(state, setState) {
  const currentStory = state.currentStory;
  const currentPage = state.currentPage;
  const next = () => setState({ currentPage: currentPage + 1 });
  if (!currentStory || stories[currentStory][currentPage] === undefined) {
    return html`
      <ul class="story">
        ${Object.keys(stories).map(
          s =>
            html`
              <li @click=${() => setState({ currentStory: s, currentPage: 0 })}>
                ${s}
              </li>
            `
        )}
      </ul>
    `;
  } else {
    const content = stories[currentStory][currentPage];
    if (content.startsWith("data:")) {
      return html`
        <img class="story" src=${content} @click=${next} />
      `;
    }
    return html`
      <h1 class="reading story" @click=${next}>${content}</h1>
    `;
  }
}
